import React, { useState } from 'react';
import {
  MDBNavbar,
  MDBContainer,
  MDBIcon,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBDropdown,
  MDBDropdownMenu,
  MDBDropdownToggle,
  MDBDropdownItem,
  MDBDropdownLink
} from 'mdb-react-ui-kit';

import './nav.css';


export default function Navi(){
    const [showNavRight, setShowNavRight] = useState(false);
    const [navBar,SetNavBar] = useState();

    const changeBackground = () => {
        if (window.scrollY >= 90){
            SetNavBar(true);
        }
        else{
            SetNavBar(false);
        }
    };

    window.addEventListener('scroll',changeBackground);    
    return(
    <div  className='UpperNav'>
    <MDBNavbar expand='lg' light className={navBar ? 'NavBar active' : 'NavBar'}>
      <div className='innerNav'>
     

       
          <MDBNavbarNav left fullWidth={false} >
            <MDBNavbarItem>
              <MDBNavbarLink active aria-current='page' href='#'>
                <h4 style={{color:'white'}} className="navp" >Home</h4>
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem>
              <MDBNavbarLink active aria-current='page' href='#'>
                <h4 style={{color:'white'}} className="navp">About Me</h4>
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem>
              <MDBNavbarLink active aria-current='page' href='#'>
                <h4 style={{color:'white'}} className="navp">What I do?</h4>
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem>
              <MDBNavbarLink active aria-current='page' href='#'>
                <h4 style={{color:'white'}} className="navp">Contact</h4>
              </MDBNavbarLink>
            </MDBNavbarItem>
            

          </MDBNavbarNav>
       
      
      </div>
    </MDBNavbar>
    </div>
    );
}
